import React from "react";
import AboutUs from "../component/AboutUs";
import "./login.css"


function LoginPage(){


    return(

        <>
    
    <div className="HomePage">
        <h3>Home Page</h3>
        </div>
    <div className="login">
        <h3>Login</h3>
        <input type="email" placeholder="Email" size="3"/>
        <input type="text" placeholder="Password" size="3"/>

    </div>
    <div className="KnightsGames">
        <div>
            
        </div>


    </div>


    <AboutUs/>

    </>
     
     )
}

export default LoginPage;
